import React from 'react';
import "./listunit.scss";


function ListUnit() {
  return (
    <div className='ListUnit'>
      <div className="ListUnit_frame">


        <div className="ListUnit_profilePicture">
            <img src="https://i.insider.com/5e8f3fe2c02320404d149a9c?width=1000&format=jpeg&auto=webp" alt="" />
        </div>

        
        <div className="ListUnit_info">
            <span>Jay</span>
            <span>Id: 121642315121541556121</span>
        </div>



        <div className="Listunit_operation">

        </div>

      </div>  
    </div>

  )
  
}

export default ListUnit
